DROP TABLE IF EXISTS depts;
create table depts (
                       id INTEGER,
                       first_name VARCHAR(50),
                       last_name VARCHAR(50),
                       country VARCHAR(50),
                       city VARCHAR(50),
                       gender VARCHAR(50),
                       birthday DATE,
                       department VARCHAR(50),
                       sold DECIMAL(7,2),
                       clients INTEGER,
                       smonth INTEGER,
                       syear INTEGER
);
